import React, { useState, useEffect } from "react";

const Home = () => {
  const [list, setList] = useState([]);

  useEffect(() => {
    getLists();
  }, []);

  const getLists = async () => {
    let result = await fetch("http://localhost:5000/details");
    result = await result.json();
    setList(result);
  };
  console.warn("list", list);

  return (
    <div className="detailsList">
      <h3>STUDENT-LIST</h3>
      <ul className="">
        <li>S.No</li>
        <li>Name</li>
        <li>Roll.No</li>
        <li>Section</li>
        <li>Branch</li>
        <li>Mobile.No</li>
        <li>Father's-Name</li>
        <li>Address</li>
        <li>Collage Name</li>
      </ul>
      {list.map((item, index) => {
        <li>{index}</li>;
      })}
    </div>
  );
};
export default Home;
